import React from 'react'
import { useNavigate } from 'react-router-dom'

export default function RegisterDetails() {
  const [name, setName] = useState("")
  const [phoneNo, setPhoneNo] = useState("")
  const [city, setCity] = useState("")
  const [state, setState] = useState("")
  const navigate = useNavigate()
  return (
    <div className='registerPage'>
      <h1>Crack Your Goal with India's top educator</h1>
      <input className='inputBox' type='text' placeholder='Fullname' value={name} onChange={(e) => setName(e.target.value)} /><br></br>

      <input className='inputBox' type='number' placeholder='Phone No.' value={phoneNo} onChange={(e) => setPhoneNo(e.target.value)} /><br></br>

      <input className='inputBox' type='text' placeholder='City' value={city} onChange={(e) => setCity(e.target.value)} /><br></br>

      <input className='inputBox' type='text' placeholder='State' value={state} onChange={(e) => setState(e.target.value)} /><br></br>

      <button onClick={function(){
        console.log("clicked")
      }} type='button'>Submit</button>
    </div>
  )
}
